import React from 'react';
import PropTypes from 'prop-types';

export default function RecipeInProgress({ match: { params: { id } } }) {
  return (
    <div>{id}</div>
  );
}

RecipeInProgress.propTypes = {
  match: PropTypes.shape({
    params: PropTypes.shape({
      id: PropTypes.string,
    }),
  }),
}.isRequired;
